import React, { useState } from 'react';
import { Menu, ChevronDown } from 'lucide-react';
import './Navigation.css';

const Navigation = () => {
  const [showCategoriesDropdown, setShowCategoriesDropdown] = useState(false);

  const allCategories = [
    { name: "Electronics", subcategories: ["Smartphones", "Laptops", "Tablets", "Accessories"] },
    { name: "Home & Kitchen", subcategories: ["Appliances", "Furniture", "Decor", "Kitchenware"] },
    { name: "Fashion", subcategories: ["Men's Clothing", "Women's Clothing", "Shoes", "Accessories"] },
    { name: "Books", subcategories: ["Fiction", "Non-Fiction", "Academic", "Children's Books"] },
    { name: "Sports & Outdoors", subcategories: ["Fitness Equipment", "Camping", "Cycling", "Team Sports"] },
    { name: "Beauty & Personal Care", subcategories: ["Skincare", "Makeup", "Hair Care", "Fragrances"] },
    { name: "Toys & Games", subcategories: ["Board Games", "Video Games", "Educational Toys", "Outdoor Toys"] },
    { name: "Health & Wellness", subcategories: ["Vitamins", "Fitness", "Personal Care", "Medical Supplies"] }
  ];

  return (
    <nav className="navigation">
      <div className="container">
        <div className="nav-wrapper">
          <div 
            className="categories-section"
            onMouseEnter={() => setShowCategoriesDropdown(true)}
            onMouseLeave={() => setShowCategoriesDropdown(false)}
          >
            <button className="categories-button">
              <Menu className="menu-icon" />
              <span className="categories-text">ALL CATEGORIES</span>
              <ChevronDown className="dropdown-icon" />
            </button>

            {showCategoriesDropdown && (
              <div className="categories-dropdown">
                {allCategories.map((category, index) => (
                  <div 
                    key={index} 
                    className="category-item"
                  >
                    <div className="category-header">
                      <span className="category-name">{category.name}</span>
                      <ChevronDown className="category-dropdown-icon" />
                    </div>
                    <div className="subcategories-dropdown">
                      {category.subcategories.map((subcategory, subIndex) => (
                        <a 
                          key={subIndex} 
                          href="#" 
                          className="subcategory-link"
                        >
                          {subcategory}
                        </a>
                      ))}
                    </div>
                  </div>
                ))}
              </div>
            )}
          </div>

          <div className="main-navigation">
            <ul className="nav-menu">
              <li><a href="#" className="nav-link">Home</a></li>
              <li className="dropdown-parent">
                <a href="#" className="nav-link">
                  Men <ChevronDown className="dropdown-icon" />
                </a>
                <ul className="dropdown-menu">
                  {["Clothing", "Footwear", "Watches", "Accessories"].map((item, index) => (
                    <li key={index}>
                      <a href="#" className="dropdown-link">{item}</a>
                    </li>
                  ))}
                </ul>
              </li>
              <li className="dropdown-parent">
                <a href="#" className="nav-link">
                  Women <ChevronDown className="dropdown-icon" />
                </a>
                <ul className="dropdown-menu">
                  {["Clothing", "Footwear", "Watches", "Accessories"].map((item, index) => (
                    <li key={index}>
                      <a href="#" className="dropdown-link">{item}</a>
                    </li>
                  ))}
                </ul>
              </li>
              <li><a href="#" className="nav-link">Blog</a></li>
              <li><a href="#" className="nav-link">Contact Us</a></li>
            </ul>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navigation;
